          <Route path="/board/:board" component={Thread} />
          <Route path="/login" component={Authenticate} />
          <Route path="*" component={NotFound} />
        </Switch>
      </div>
      <Footer />
    </Router>
  </React.StrictMode>,
  document.getElementById("root")
